rk to the project's directory\n\t\tcp -R \"${UNIVERSAL_OUTPUTFOLDER}/${PROJECT_NAME}.framework\" \"${PROJECT_DIR}\"\n\n\t\t# Step 6. Convenience step to open the project's directory in Finder\n\t\t# open \"${PROJECT_DIR}\"\n\n\tfi\n\nfi\n";
